import React from 'react';
import { Layout } from './Layout';
import { useAuth } from '../../../hooks/useAuth';

export const PlaceReviws = ({ placeId, reviews }) => {
    const {token} = useAuth();
    const [ show, setShow ] = React.useState(false);

    return <Layout show={show} setShow={setShow} reviews={reviews} token={token} placeId={placeId} />
}
